              function jq(obj){

	return typeof(obj) == "string" ? document.getElementById(obj) : obj;

}



      var layerHeight = 300;



      var iFrame = 1;



      var iFrequency = 100;



      var speed = 10;



      var timer;



      var n1 = jq("recently_sold_items");



      var n2 = jq("recently_sold_items_a");



      var n3 = jq("recently_sold_items_b");



      var goup = jq("goup");



      var godown = jq("godown")



      var h1 = n2.offsetHeight-layerHeight; 



        if(n2.offsetHeight >= layerHeight)



          n1.style.height = layerHeight+'px';



        else



          n1.style.height = /*n2.offsetHeight*/layerHeight+'px';



          n3.innerHTML = n2.innerHTML;



        function move(){



            if(n1.scrollTop >= n2.offsetHeight)



              n1.scrollTop -= (n2.offsetHeight - iFrame);



            else        



              n1.scrollTop += iFrame;



              if(n1.scrollTop<=0) n1.scrollTop=h1-n1.scrollTop;



        }   



        goup.onmousedown = function (){iFrame = +speed;return false;};



        goup.onmouseup = function(){iFrame=1};



        godown.onmousedown = function (){iFrame = -speed;return false;};



        godown.onmouseup = function(){iFrame=1};



        timer = setInterval("move()",iFrequency);



        n1.onmouseover=function() {clearInterval(timer);}



        n1.onmouseout=function() {timer=setInterval("move()",iFrequency);iFrame=1;}

    function goTopEx() {
    var obj = document.getElementById("gototop");
    function getScrollTop() {
        return document.documentElement.scrollTop || document.body.scrollTop;
    }
    function setScrollTop(value) {
        document.documentElement.scrollTop = value;document.body.scrollTop = value;
    }
    window.onscroll = function () { getScrollTop() > 0 ? obj.style.display = "block" : obj.style.display = "none"; }
    obj.onclick = function () {
        var goTop = setInterval(scrollMove, 100);
        function scrollMove() {
            setScrollTop(getScrollTop() / 6);
            if (getScrollTop() < 1) clearInterval(goTop);
        }
    }
}
$(function(){
	goTopEx();
});
